(3, 1, 'jilibet777', 'admin@jilibet777.net', 'https://jilibet777.net', '45.204.209.253', '2025-12-30 01:52:26', '2025-12-30 01:52:26', 'Been playing on <a href=\'https://jilibet777.net\' rel=\"nofollow ugc\">jilibet777</a>  for a while now, and the payouts are legit.  Had a pretty good run last week â€“ cashed out no problem.  Give it a try, you might get lucky too!', 0, '0', 'Mozilla/5.0 (iPhone; CPU iPhone OS 18_3_2 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/18.3.1 Mobile/15E148 Safari/604.1', 'comment', 0, 0);
